            soft_reset_confirm_3: "您确定已知晓接下来会发生的事吗？",
            soft_reset_2_confirm:
              "您准备好阻止亡者大军了吗？登攀者世界和所有王国的存续寄于您一身了",
            soft_reset_description_1_true:
              "光荣退休是本游戏第一种转生。每次转生，您都可以获得所有资源的永久加成，并根据声誉数值获得传承点数，用来购买下方的永久加成。转生后，所有游戏进度都将重置(成就，统计和传承加成除外)，并开始下周目游戏",
            soft_reset_description_2_true:
              "您击败了亡者大军，登攀者世界从亡灵天灾的魔爪中得救了。击败它们后，您获得了1遗物。由于您的光荣胜利，您可以继续玩下去，也可以选择转生了。每次转生，您都可以获得所有资源的永久加成，并根据声誉数值获得传承点数，用来购买下方的永久加成。转生后，所有游戏进度都将重置(成就，统计和传承加成除外)，并开始下周目游戏",
            soft_reset_description_2_false:
              "亡者大军从门内涌现出来，摧毁了您的城市。登攀者世界的王国一个接一个地沦陷了，这片大地沦为了亡者的猎场。每次转生，您都可以获得所有资源的永久加成，并根据声誉数值获得传承点数，用来购买下方的永久加成。转生后，所有游戏进度都将重置(成就，统计和传承加成除外)，并开始下周目游戏",
            soft_reset_description_3_true:
              "您控制了整个登攀者世界的经济命脉，没有哪个王国能够逃离您的掌控。转生后，您除了可以获得传承点数以外，还可以获得1代币。每次转生，您都可以获得所有资源的永久加成，并根据声誉数值获得传承点数，用来购买下方的永久加成。转生后，所有游戏进度都将重置(成就，统计和传承加成除外)，并开始下周目游戏",
            soft_reset_description_4_true:
              "神明们欢迎了您的进入，尘世生活的种种已经是遥远的模糊记忆。您可以尽情享受永恒的欢愉，但登攀者世界终究会再次需要您。转生后，您除了可以获得传承点数以外，还可以获得1智慧卷轴。每次转生，您都可以获得所有资源的永久加成，并根据声誉数值获得传承点数，用来购买下方的永久加成。转生后，所有游戏进度都将重置(成就，统计和传承加成除外)，并开始下周目游戏",
            soft_reset_description_5_false:
              "号角声，嚎叫声和战吼声突然打破了夜晚的宁静。士兵们冲向防线，但地精狼骑兵已经包围了他们。漆黑如夜的箭矢射向士兵们，上面的毒很快生效了。地精们蜂拥而至，掠夺并摧毁了您辛辛苦苦建造的一切。如果我们加强防御，增派人手，就应该能干掉这群该死的绿皮们……您失败了，但这并不是登攀者世界的末日！由于您积累了声誉数值，您可以使用传承点数来购买永久加成，它们在接下来的游戏中会很有帮助的",
            soft_reset_description_6_false:
              "我们英勇的战士再次紧密团结，准备战斗。红龙浮现于城市之上，龙仆们落于城墙，开始了死战。士兵们勇敢地战斗，但最后红龙决定结束战斗。它炽热的吐息摧毁了城墙，和路上的一切事物。整个城市都在燃烧，平民们被迫为了自己而战。到处都是尖叫，毁灭和灰烬。战斗，失败了……您失败了，但这并不是登攀者世界的末日！由于您积累了声誉数值，您可以使用传承点数来购买永久加成，它们在接下来的游戏中会很有帮助的",
            soft_reset_description_7_false:
              "城墙上传来了尖叫声，城中的士兵们还在试图弄清楚发生了什么。不久之后，敌人的先头部队举着黑洞洞的枪口轰平了我们的驻地。一个有着黑色巨翼，穿着盔甲的家伙飞过了一支拿着火枪的恶魔部队。毁灭城市之前，它留下了这些话：谢谢你的信任，我才能武装起我的军团，现在，是时候让你品尝一下什么叫做堕天使的正义了！您失败了，但这并不是登攀者世界的末日！由于您积累了声誉数值，您可以使用传承点数来购买永久加成，它们在接下来的游戏中会很有帮助的",
            soft_reset_description_8_false:
              "我们的城市已经严阵以待了，奈何敌人实在是不讲武德。首先涌入的是一群小恶魔，它们喷火焚烧了我们的防御工事，然后在堕天使的命令下，高等恶魔们开始行进。高达十尺的怪物们将无助的士兵们抛向了高空，其他士兵则被那群混账东西肆意蹂躏。堕天使发出了大仇得报的笑声，声音响彻全城……您失败了，但这并不是登攀者世界的末日！由于您积累了声誉数值，您可以使用传承点数来购买永久加成，它们在接下来的游戏中会很有帮助的",
            soft_reset_description_9_false:
              "兽人族曾引以为傲的堡垒已经变成了废墟，兽人部落开始了最后的绝望冲锋。他们眼中燃烧着火焰，手持武器，冲向我们的城墙，试图将其突破。数个世纪以来，我们的军队与最可怕的敌人交战过，久经战阵，他们坚守阵地，与兽人们激战了数日。两方的命运看起来悬而未决，但突然，战争的天平发生了倾斜，结局似乎已经近在眼前。人类竭尽全力战斗，他们知道一旦战败，等待他们的只有被奴役，甚至更可怕的事。兽人部落无情的毁灭浪潮继续冲击着城市，城市坚持到了最后，但还是陷落了。登攀者世界完了，人类也完了。留给后世的，只有苦涩的记忆，那些为了人类而战的牺牲，以及曾经闪耀，却永远熄灭的希望。您失败了，但这并不是登攀者世界的末日！由于您积累了声誉数值，您可以使用传承点数来购买永久加成，它们在接下来的游戏中会很有帮助的",
            soft_reset_description_10_false:
              "在深渊最深处，与无智之恶的最终决战拉开了帷幕。人类与精灵联军严阵以待，他们战胜莫德凯男爵和魅魔女王而铸就了钢铁意志，却在无智之恶的面前显得如此苍白。战斗打响之时，比任何黑夜都浓稠的黑暗吞噬了整个战场，光明与希望皆被吞没。无智之恶——这个由纯粹混沌和仇恨构成的混沌实体，以令人战栗的流体姿态游走着。它的存在扭曲现实，仅仅靠近就足以让士兵陷入疯狂。光明与火焰的咒语在吞噬虚空面前犹如泥牛入海。尽管英勇奋战，但登攀者世界的守卫者们仍被彻底压制。深渊不可名状之恐怖以无情的凶残撕开战线，人类最伟大的勇士们与精灵盟友们虽殊死搏斗，却终究难敌这毁灭性的攻势。勇士们接连倒下。曾指引前路的信标逐一熄灭。阵亡者的惨叫被无尽的虚空吞没。鲜血浸透战场，垂死者的哀嚎在深渊中回荡，谱写着绝望的幽冥交响曲。当最后的抵抗火苗熄灭时，战场陷入刺骨的死寂。获胜的无智之恶将阴影蔓延至整个登攀者世界，曾经生机勃勃的土地坠入黑暗绝望的纪元。宏伟的城市崩塌，连自然本身都在恶意侵蚀下扭曲变形。他们英勇抗争的故事化作警示后世的低语传说，诉说着导致覆灭的傲慢。挣脱深渊桎梏的希望之火已然熄灭，只余往昔的残影。再无约束的无智之恶在登攀者世界的统治中狂欢。零星的幸存者在永恒的恐惧中苟活，心灵早已破碎。世界被不可逆转地改变，希望之光永远熄灭，唯余永恒的黑暗",
            soft_reset_description_11_false:
              "发射灭世终焉是一种转生。每次发射后，您都可以使所有产量增加4%，声誉增加2%，获得2光明，2幸运石，且军队上限增加10。您可根据声誉数值获得传承点数，用来购买永久加成。转生后，所有游戏进度都将重置(成就，统计和传承加成除外)，并开始下周目游戏",
